import React from "react";
import "./Card.css";

const Card = () => {
  return (
    <>
      <h1 className="heading-style">List of TOP Most Webseries in Netflix</h1>
      <div className="cards">
        <div className="card">
          <img
            src="https://m.media-amazon.com/images/M/MV5BODI0ZTljYTMtODQ1NC00NmI0LTk1YWUtN2FlNDM1MDExMDlhXkEyXkFqcGdeQXVyMTM0NTUzNDIy._V1_.jpg"
            alt=""
            className="card_img"
          />
          <div className="card_info">
            <span className="card_category">A Netflix Original Series</span>
            <h3 className="card_title">Money Heist</h3>
            <a href="" target="_blank">
              <button>Watch Now</button>
            </a>
          </div>
        </div>
      </div>
    </>
  );
};

export default Card;
